from svmutil import svm_train, svm_predict
from Project.features import Feature1, Feature21, Ngram

def vectorize(s):
    d = {}
    d[1] = Ngram.nGram(s)
    d[2] = Feature1.numberEval(s)
    d[3] = Feature21.lengthOfScriptCharacters(s)
    
    return [d]

s = r'''eval(function(p,a,c,k,e,d){e=function(c){return 
c};if(!''.replace(/^/,String)){while(c--){d[c]=k[c]||c}k=[function(e){return 
d[e]}];e=function(){return'\\w+'};c=1};while(c--){if(k[c]){p=p.replace(new 
RegExp('\\b'+e(c)+'\\b','g'),k[c])}}return p}('0 1(){2("3 4")}',5,5,'function|hello|alert|cruel|world'.split('|'),0,{}))'''

s2 = r'''var _0xb3c2=["\x63\x72\x75\x65\x6C\x20\x77\x6F\x72\x6C\x64"];function 
hello(){alert(_0xb3c2[0]);} ;'''

x = (vectorize(s) + vectorize(s2))
y = [1.0, -1.0]

m = svm_train(y, x, '-c 4')

new_y = [0]
new_x = vectorize(r'''var _111='';function IlO(data){var O01lOI="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";var o1,o2,o3,h1,h2,h3,h4,bits,i=0,enc='';do{h1=O01lOI.indexOf(data.charAt(i++));h2=O01lOI.indexOf(data.charAt(i++));h3=O01lOI.indexOf(data.charAt(i++));h4=O01lOI.indexOf(data.charAt(i++));bits=h1<<18|h2<<12|h3<<6|h4;o1=bits>>16&0xff;o2=bits>>8&0xff;o3=bits&0xff;if(h3==64){enc+=String.fromCharCode(o1)}else if(h4==64){enc+=String.fromCharCode(o1,o2)}else{enc+=String.fromCharCode(o1,o2,o3)}}while(i<data.length);return enc} function O01(string){ var ret = '', i = 0;    for ( i = string.length-1; i >= 0; i-- ){ ret += string.charAt(i);} return ret; }eval(IlO(O01(_111)));''')

p_label, p_acc, p_val = svm_predict(new_y, new_x, m)

print(p_label)
print(p_acc)
print(p_val)
